document.addEventListener("DOMContentLoaded",(function(){document.querySelectorAll("button[data-bs-target='#modalEdit']").forEach((e=>{e.addEventListener("click",(function(){let e=this.closest("tr"),t=e.querySelector(".data-id").value,a=e.querySelector(".data-nama").value,n=e.querySelector(".data-telepon").value;document.querySelector("#modalEdit input[name='id']").value=t,document.querySelector("#modalEdit input[name='nama']").value=a,document.querySelector("#modalEdit input[name='telepon']").value=n}))}))}));